            style={{ textDecoration: "none", color: "inherit" }}
          >
            <ListItem button>
              <ListItemText primary="Profile" />
            </ListItem>
          </Link>
          <Divider />
          <Link
            to="/PastTrips"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <ListItem button>
              <ListItemText primary="Trips" />
            </ListItem>
          </Link>
          <Divider light />
          <Link
            to="/ContactUs"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <ListItem button>
              <ListItemText primary="Contact Us" />
            </ListItem>
          </Link>
          {this.props.currentUser.activeTrip ? (
            <>
              <Divider light />
              <ListItem button divider>
                <ListItemText primary="Upload Photos" />
              </ListItem>
            </>
          ) : (
            ""
          )}
        </List>
      </div>
    </div>
    );
  }
}

